const e=JSON.parse('{"key":"v-d1cb3978","path":"/train/practice/models/m1.html","title":"M1-布局线长预测时延","lang":"zh-CN","frontmatter":{"title":"M1-布局线长预测时延","order":1},"headers":[{"level":3,"title":"1 问题背景","slug":"_1-问题背景","link":"#_1-问题背景","children":[]},{"level":3,"title":"2 问题描述","slug":"_2-问题描述","link":"#_2-问题描述","children":[]},{"level":3,"title":"3 输入输出","slug":"_3-输入输出","link":"#_3-输入输出","children":[]},{"level":3,"title":"4 评估指标","slug":"_4-评估指标","link":"#_4-评估指标","children":[]},{"level":3,"title":"5 参考模型","slug":"_5-参考模型","link":"#_5-参考模型","children":[]}],"git":{"createdTime":1719138368000,"updatedTime":1720543774000,"contributors":[{"name":"Xingquan-Li","email":"fzulxq@gmail.com","commits":2},{"name":"simintao","email":"simintao@126.com","commits":2},{"name":"liuh0326@163.com","email":"liuh0326@163.com","commits":1}]},"readingTime":{"minutes":3.73,"words":1119},"filePathRelative":"train/practice/models/m1.md","localizedDate":"2024年6月23日","excerpt":"<h3> <strong>1 问题背景</strong></h3>\\n<p>线长预测时延是指在芯片设计过程中，利用EDA工具对连线的长度进行估计，并进一步预测信号传输的时延。不同信号线的长度会影响信号传输的时延。较长的信号线会导致信号传输所需的时间增加，从而可能导致时序问题和性能下降。因此，在Global Routing阶段的线长进行Detail routing阶段后的时延预测可以帮助评估和优化信号传输的性能。</p>\\n<p>线长预测时延通常通过以下步骤进行：</p>\\n<p>​                ● <strong>建立模型</strong>：使用EDA工具，基于芯片设计的物理布局信息和电路参数，建立信号传输时延的数学模型。这些模型通常考虑了电阻、电容、工艺因素等对信号传输的影响。</p>","copyright":{"author":"iEDA","license":"GPL-3.0"}}');export{e as data};
